@prefix : <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:Bank a owl:Class .
:Account a owl:Class .
:Limit a owl:Class .

:hasLimit a owl:ObjectProperty ;
  rdfs:domain :Bank ;
  rdfs:range :Limit .

:appliesToAccount a owl:ObjectProperty ;
  rdfs:domain :Limit ;
  rdfs:range :Account .

:amount a owl:DatatypeProperty ;
  rdfs:domain :Limit ;
  rdfs:range xsd:decimal .

:perDay a owl:DatatypeProperty ;
  rdfs:domain :Limit ;
  rdfs:range xsd:boolean .

:perMonth a owl:DatatypeProperty ;
  rdfs:domain :Limit ;
  rdfs:range xsd:boolean .
